import React from 'react';
import { Link, Outlet } from 'react-router-dom';
import JudgeDisplayAll from './JudgeDisplay'

const Judges = () => {
    return (
        <div className='container'>
            <div id="judgeNav" className="flex justify-center">
                <Link to="/judge/new" className="ring-1 ring-offset-stone-100 bg-emerald-500 text-white hover:bg-emerald-800 py-1 px-2 rounded-full mx-1">Create</Link>
                <Link to="/judge/:id" className="ring-1 ring-offset-stone-100 bg-blue-500 text-white hover:bg-blue-800 py-1 px-2 rounded-full mx-1">Read</Link>
                <Link to="/judge/edit/:id">Edit</Link>
            </div>

            <Outlet />
        </div>
    )
}

export default Judges
